  export function getFeaturedEvents() {
    return DUMMY_EVENTS.slice(0,30).sort((a, b) => b.id - a.id).filter((event) => event.symbol.length > 1);
  }
  
  export function getAllEvents() {
    return DUMMY_EVENTS;
  }
  
  export function getFilteredEvents(dateFilter) {
    const { year, month } = dateFilter;
  
    let filteredEvents = DUMMY_EVENTS.filter((event) => {
      const eventDate = new Date(event.date);
      return eventDate.getFullYear() === year && eventDate.getMonth() === month - 1;
    });
  
    return filteredEvents;
  }
  
  export function getEventById(id) {
    return DUMMY_EVENTS.find((event) => event.symbol === id);
  }

  export function getEventsById(query) {
    const newArray = DUMMY_EVENTS.filter(event => event.symbol.includes(query.toUpperCase()))

    return newArray;
  }